                  "import { Button, message } from 'antd';\nimport ButtonGroup from 'antd/lib/button/button-group';\nimport React, { useState } from 'react';\nimport CanvasCharged from '..';\nimport CanvasRect from '../CanvasRect';\nimport './index.less';\n\nconst url = 'https://cdn.pixabay.com/photo/2020/06/18/09/25/waterfall-5312692_1280.jpg';\nconst fakeData = [\n  new CanvasRect(\n    {\n      x: 50,\n      y: 50,\n    },\n    {\n      x: 70,\n      y: 70,\n    },\n    'orange',\n    0,\n  ),\n  new CanvasRect(\n    {\n      x: 80,\n      y: 80,\n    },\n    {\n      x: 90,\n      y: 90,\n    },\n    'orange',\n    1,\n  ),\n];\n\nconst CanvasDemo = () => {\n  const [size, setSize] = useState(null);\n  const [blockVisible, setBlockVisible] = useState(false);\n  const [color, setColor] = useState('#f11');\n  const [mode, setMode] = useState('draw'); // const [naturalSize, setNaturalSize] = useState<Size>();\n\n  const [rects, setRects] = useState(fakeData);\n  const imageStyle = {\n    width: size?.w,\n    height: size?.h,\n  };\n\n  function getLoadedSize(e) {\n    setSize({\n      w: e.target.naturalWidth,\n      h: e.target.naturalHeight,\n    });\n  } // standard remove action\n\n  const [selected, setSelected] = useState(null);\n\n  const getInstance = rect => {\n    message.info(`Selected item's id: ${rect.id}`);\n    setSelected(rect);\n    console.log(rect);\n  };\n\n  const removeItem = () => {\n    if (mode === 'select' && selected) {\n      setRects(s => {\n        const updatedState = [...s];\n        const index = updatedState.findIndex(item => item.id === selected.id);\n        updatedState.splice(index, 1);\n        console.log('updatedState,', updatedState);\n        return updatedState;\n      });\n      setSelected(null);\n      message.success('Removed !');\n    }\n  };\n\n  return (\n    <div className=\"demo-canvas-wrapper\">\n      <div className=\"canvas-header\">\n        <ButtonGroup className=\"button-group\">\n          <Button type={mode === 'draw' ? 'primary' : 'ghost'} onClick={() => setMode('draw')}>\n            drawing-mode\n          </Button>\n          <Button type={mode === 'select' ? 'primary' : 'ghost'} onClick={() => setMode('select')}>\n            selecting-mode\n          </Button>\n        </ButtonGroup>\n        <ButtonGroup className=\"button-group\">\n          <Button type=\"danger\" onClick={removeItem}>\n            remove-selected\n          </Button>\n        </ButtonGroup>\n        <ButtonGroup className=\"button-group\">\n          <Button type={color === '#f11' ? 'danger' : 'ghost'} onClick={() => setColor('#f11')}>\n            color:red\n          </Button>\n          <Button type={color === '#0fe' ? 'primary' : 'ghost'} onClick={() => setColor('#0fe')}>\n            color:blue\n          </Button>\n        </ButtonGroup>\n\n        <ButtonGroup className=\"button-group\">\n          <Button type={blockVisible ? 'primary' : 'ghost'} onClick={() => setBlockVisible(true)}>\n            block:visible\n          </Button>\n          <Button type={!blockVisible ? 'primary' : 'ghost'} onClick={() => setBlockVisible(false)}>\n            block:invisible\n          </Button>\n        </ButtonGroup>\n      </div>\n      <div\n        className=\"demo-canvas-wrapper\"\n        style={{\n          width: size?.w,\n          height: size?.h,\n        }}\n      >\n        <img\n          src={url}\n          style={imageStyle}\n          alt=\"turbine defects\"\n          onLoad={getLoadedSize}\n          className=\"g-canvas-image\"\n          onClick={e = /> e.preventDefault()}\n          onMouseDown={e => e.preventDefault()}\n        />\n        <CanvasCharged\n          size={size}\n          color={color}\n          rects={rects}\n          setRects={setRects}\n          onClick={getInstance}\n          blockVisible={blockVisible}\n          mode={mode}\n        />\n      </div>\n    </div>\n  );\n};\n\nexport default () => <CanvasDemo />;\n",
