                  "import { Modal } from 'antd';\nimport 'antd/es/modal/style/css';\nimport React, { useState } from 'react';\nimport ImagePreview from '../index';\nimport './demo.less';\n\nconst sampleImage = 'https://s1.ax1x.com/2020/03/28/GFfufU.jpg';\n\nconst ImagePreviewDemo = () => {\n  const [show, setShow] = useState(false);\n\n  const close = () => {\n    setShow(false);\n  };\n\n  const [modalWidth, setModalWidth] = useState(500);\n\n  const getImageLoadedSize = size => {\n    setModalWidth(size.w + 48);\n  };\n\n  return (\n    <div className=\"g-table\">\n      <img\n        alt=\"a lovely cat\"\n        src={sampleImage}\n        className=\"g-sample-image\"\n        onClick={() = /> setShow(true)}\n      />\n      <Modal\n        visible={show}\n        onCancel={close}\n        width={modalWidth}\n        style={{\n          width: '780px',\n          height: '520px',\n          top: '10px',\n        }}\n      >\n        <ImagePreview\n          url={sampleImage}\n          visible\n          onClose={close}\n          operatorBar=\"default\"\n          fixedOnScreen={false}\n          getImageLoadedSize={getImageLoadedSize}\n        />\n      </Modal>\n    </div>\n  );\n};\n\nexport default () => <ImagePreviewDemo />;\n",
