                  path: './index.less',
                  content:
                    '.g-image-preview-wrapper {\n  display: flex;\n  justify-content: center;\n  align-items: center;\n  flex-direction: column;\n  padding-bottom: 0 !important;\n}\n\n.g-fixed {\n  position: fixed;\n  top: 0;\n  bottom: 0;\n  left: 0;\n  right: 0;\n  background: #00000078;\n  overflow: hidden;\n  z-index: 100; //!\n}\n\n.g-image-preview-icon-close {\n  position: absolute;\n  top: 10px;\n  right: 20px;\n  color: white;\n  font-size: 26px;\n  cursor: pointer;\n  &:hover {\n    color: rgba(241, 74, 102, 0.9);\n    transition: 0.3s ease-in-out;\n  }\n}\n\n.g-image-preview-image {\n  cursor: move;\n  position: absolute;\n}\n\n.g-image-preview-action-toolbar {\n  position: absolute;\n  bottom: 0px;\n  width: 100%;\n  height: 50px;\n  display: flex;\n  line-height: 50px;\n  align-items: center;\n  flex-flow: row nowrap;\n  justify-content: center;\n  & > i {\n    color: white;\n    font-size: 26px;\n    cursor: pointer;\n    margin-left: 30px;\n    background: none;\n    border: none;\n    outline: none;\n    &:hover {\n      color: rgba(74, 236, 241, 0.9);\n      transition: 0.3s ease-in-out;\n    }\n    &:first-child {\n      margin: 0;\n    }\n  }\n}\n',
